import {Route, Switch} from "reaact-router-dom";
import ProductContainer from "./components/ProductContainer";
import NavBar from "./components/NavBar"

function App() {
  return (
    <div >
      <NavBar />
      <ProductContainer />
      <Switch>
        <Route path="/addr">
        <AddProduct />
        </Route>
      </Switch>

    </div>
  );
}

export default App;
